el30.innerHTML = "\n        :root {\n            --surface_top: 0px;\n            --humus_top: 0px;\n            --topsoil_top: 0px;\n            --subsoil_top: 0px;\n            --weatheredRock_top: -1px;\n            --bedrock_top: 0px;\n            --main_left: 0px;\n        }\n\n        .svg_cont {\n            margin: 0px;\n            padding: 0px;\n            border: 0px;\n            text-align: center;\n            width: fit-content;\n            height: fit-content;\n        }\n\n        #surface_svg,\n        #humus_svg,\n        #topsoil_svg,\n        #subsoil_svg,\n        #weatheredRockFragments_svg,\n        #bedrock_svg {\n            position: relative;\n            display: block;\n            background-color: none !important;\n        }\n\n        #surface_svg {\n            overflow: visible;\n            top: 0px;\n            left: var(--main_left) !important;\n        }\n\n        #humus_svg {\n            overflow: visible;\n            top: var(--surface_top);\n            left: var(--main_left) !important;\n        }\n\n        #topsoil_svg {\n            overflow: visible;\n            top: calc(var(--surface_top) + var(--humus_top));\n            left: var(--main_left) !important;\n        }\n\n        #subsoil_svg {\n            overflow: visible;\n            top: calc(var(--surface_top) + var(--humus_top) + var(--topsoil_top));\n            left: var(--main_left) !important;\n        }\n\n        #weatheredRockFragments_svg {\n            overflow: visible;\n            top: calc(var(--surface_top) + var(--humus_top) + var(--topsoil_top) + var(--subsoil_top));\n            left: var(--main_left) !important;\n        }\n\n        #bedrock_svg {\n            overflow: visible;\n            top: var(--weatheredRock_top);\n            left: var(--main_left) !important;\n        }\n\n        .tabloidSoil {\n            font-size: 1.8vmin;\n        }\n\n        .tabSoil {\n            overflow: hidden;\n            border: 1px solid #ccc;\n            background-color: #f1f1f1;\n            padding: 0px 0px;\n            width: 100%;\n        }\n\n        .tabSoil button {\n            background-color: inherit;\n            color: black;\n            float: left;\n            border: none;\n            border-left: 1px solid #ddd;\n            border-right: 1px solid #ddd;\n            outline: none;\n            cursor: pointer;\n            padding: 5px 15px;\n            transition: 0.3s;\n        }\n\n        .tabSoil button:hover {\n            background-color: #63daeb;\n            color: white;\n        }\n\n        .tabSoil button.active {\n            background-color: #17a2b8;\n            border: none;\n            color: white;\n        }\n\n        .tabcontentSoil {\n            display: none;\n            flex-flow: row;\n            place-content: stretch center;\n            align-items: flex-start;\n\n            width: 100%;\n            padding: 12px 12px;\n            border: 1px solid #17a2b8;\n\n            overflow-x: hidden;\n\n            height: 96%;\n\n            box-sizing: inherit;\n\n            overflow-y: scroll;\n        }\n    ";
