var el3601 = document.createElement('script');
el3601.text = "\n        \$(document).ready(function () {\n            \$(\".popover-toggle\").popover({\n                html: true,\n            });\n        });\n        \$(document).on(\"click\", \".popover .close\", function () {\n            \$(this).parents(\".popover\").popover(\"hide\");\n        });\n\n        document\n            .getElementById(\"vineyard_landPrep_physical_yes\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_fieldOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = !this.checked;\n                }\n            });\n        document\n            .getElementById(\"vineyard_landPrep_physical_no\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_fieldOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = this.checked;\n                }\n            });\n\n        document\n            .getElementById(\"vineyard_landPrep_fert_yes\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_fertOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = !this.checked;\n                }\n            });\n        document\n            .getElementById(\"vineyard_landPrep_fert_no\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_fertOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = this.checked;\n                }\n            });\n\n        document\n            .getElementById(\"vineyard_landPrep_greenM_yes\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_seedingOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = !this.checked;\n                }\n            });\n        document\n            .getElementById(\"vineyard_landPrep_greenM_no\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_seedingOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = this.checked;\n                }\n            });\n\n        document\n            .getElementById(\"vineyard_landPrep_herbicide_yes\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_herbOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = !this.checked;\n                }\n            });\n        document\n            .getElementById(\"vineyard_landPrep_herbicide_no\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_herbOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = this.checked;\n                }\n            });\n\n        document\n            .getElementById(\"vineyard_landPrep_pesticide_yes\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_pestOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = !this.checked;\n                }\n            });\n        document\n            .getElementById(\"vineyard_landPrep_pesticide_no\")\n            .addEventListener(\"change\", function () {\n                var elements = document.getElementsByClassName(\"prep_pestOps\");\n                for (var i = 0; i \u003c elements.length; i++) {\n                    elements[i].hidden = this.checked;\n                }\n            });\n\n        document\n            .getElementById(\"harvest_Mech\")\n            .addEventListener(\"change\", function () {\n                const harvest_Mech = document.getElementById(\"harvest_Mech\").value;\n                document.getElementById(\"harvest_Mech_container\").hidden =\n                    harvest_Mech == 0;\n                const harvest_Man = document.getElementById(\"harvest_Man\").value;\n                document.getElementById(\"harvest_Man_container\").hidden =\n                    harvest_Man == 0;\n            });\n\n        document\n            .getElementById(\"harvest_Man\")\n            .addEventListener(\"change\", function () {\n                const harvest_Man = document.getElementById(\"harvest_Man\").value;\n                document.getElementById(\"harvest_Man_container\").hidden =\n                    harvest_Man == 0;\n                const harvest_Mech = document.getElementById(\"harvest_Mech\").value;\n                document.getElementById(\"harvest_Mech_container\").hidden =\n                    harvest_Mech == 0;\n            });\n\n\n        // set value of the soil color input field to empty string when clicked\n        document\n            .getElementById(\"soilColorText__horiz0_Input\")\n            .addEventListener(\"click\", function () {\n                document.getElementById(\"soilColorText__horiz0_Input\").value = \"\";\n            });\n\n        document\n            .getElementById(\"soilColorText__horiz1_Input\")\n            .addEventListener(\"click\", function () {\n                document.getElementById(\"soilColorText__horiz1_Input\").value = \"\";\n            });\n\n        document\n            .getElementById(\"soilColorText__horiz2_Input\")\n            .addEventListener(\"click\", function () {\n                document.getElementById(\"soilColorText__horiz2_Input\").value = \"\";\n            });\n\n        document\n            .getElementById(\"soilColorText__horiz3_Input\")\n            .addEventListener(\"click\", function () {\n                document.getElementById(\"soilColorText__horiz3_Input\").value = \"\";\n            });\n\n\n    ";
